Cast: Derrick Pierce, John Strong, Danny Wylde, Tommy Pistol, Brian Street Team, Mary Jane, Krysta Kaos, Juliette Black, Azure Maddox

You've seen them in their black leather jackets and skintight jeans. They're sexy rebels from burned-out towns, playing by their own rules and living up to their bad reputations. These are the young ladies multiple 2012 AVN award nominee Joanna Angel calls the Twisted Youth, and they're ready to rock your world in this all-new DVD from Burning Angel Entertainment and Vouyer Media. Aria Rae, Azure Maddox, Juliette Black, Mary Jane and Krysta Kaos run wild in the streets from the very first scene, combing out their bangs and donning dark eyeliner before throwing down nearly three hours of intense screwing!
